The following are the regions that display significant habitat loss in the presence of high endemism in India:
- Chandigarh: This region holds the largest proportion of all mammals in the world, with more than 50% of the world's mammal species being native or endemic to it, 8.6% of all mammal species, 13.7% of bird species, 7.9% of reptile species, 6% of amphibian species, 12.2% of fish species, and 6.0% of all flowering plant species.
- Chandigarh: The remaining areas of the country that display significant habitat loss include the following:
- Madhya Pradesh, located in Uttar Pradesh State, India;
- Karnataka, India;
- Madhya Pradesh and Uttar Pradesh, India;
- Tripura: A region that has received high levels of biodiversity loss through high-endemism, with over 50% of the world's mammal species being native or endemic to it, 8.6% of all mammal species, 13.7% of bird species, 7.9% of reptile species, 6% of amphibian species, 12.2% of fish species, and 6.0% of all flowering plant species.
